(1133, 2, '2013-03-15 18:19:23', '2013-03-15 23:19:23', 'Welcome to image alignment! The best way to demonstrate the ebb and flow of the various image positioning options is to nestle them snuggly among an ocean of words. Grab a paddle and let''s get started.\n\nOn the topic of alignment, it should be noted that users can choose from the options of <em>None</em>, <em>Left</em>, <em>Right, </em>and <em>Center</em>. In addition, they also get the options of <em>Thumbnail</em>, <em>Medium</em>, <em>Large</em> &amp; <em>Fullsize</em>.\n<p style="text-align:center;"><img class="size-full wp-image-906 aligncenter" title="Image Alignment 580x300" alt="Image Alignment 580x300" src="http://ellie.themes.zone/wp-content/uploads/2013/03/image-alignment-580x300.jpg" width="580" height="300" /></p>\nThe image above happens to be <em><strong>centered</strong></em>.\n\n<strong><img class="size-full wp-image-904 alignleft" title="Image Alignment 150x150" alt="Image Alignment 150x150" src="http://ellie.themes.zone/wp-content/uploads/2013/03/image-alignment-150x150.jpg" width="150" height="150" /></strong>The rest of this paragraph is filler for the sake of seeing the text wrap around the 150x150 image, which is <em><strong>left aligned</strong></em>. <strong></strong>\n\nAs you can see the should be some space above, below, and to the right of the image. The text should not be creeping on the image. Creeping is just not right. Images need breathing room too. Let them speak like you words. Let them do their jobs without any hassle from the text. In about one more sentence here, we''ll see that the text moves from the right of the image down below the image in seamless transition. Again, letting the do it''s thang. Mission accomplished!\n\nAnd now for a <em><strong>massively large image</strong></em>. It also has <em><strong>no alignment</strong></em>.\n\n<img class="alignnone  wp-image-907" title="Image Alignment 1200x400" alt="Image Alignment 1200x400" src="http://ellie.themes.zone/wp-content/uploads/2013/03/image-alignment-1200x4002.jpg" width="1200" height="400" />\n\nThe image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.\n\n<img class="size-full wp-image-905 alignright" title="Image Alignment 300x200" alt="Image Alignment 300x200" src="http://ellie.themes.zone/wp-content/uploads/2013/03/image-alignment-300x200.jpg" width="300" height="200" />\n\nAnd now we''re going to shift things to the <em><strong>right align</strong></em>. Again, there should be plenty of room above, below, and to the left of the image. Just look at him there... Hey guy! Way to rock that right side. I don''t care what the left aligned image says, you look great. Don''t let anyone else tell you differently.\n\nIn just a bit here, you should see the text start to wrap below the right aligned image and settle in nicely. There should still be plenty of room and everything should be sitting pretty. Yeah... Just like that. It never felt so good to be right.\n\nAnd just when you thought we were done, we''re going to do them all over again with captions!\n\n[caption id="attachment_906" align="aligncenter" width="580"]<img class="size-full wp-image-906  " title="Image Alignment 580x300" alt="Image Alignment 580x300" src="http://ellie.themes.zone/wp-content/uploads/2013/03/image-alignment-580x300.jpg" width="580" height="300" /> Look at 580x300 getting some <a title="Image Settings" href="https://en.support.wordpress.com/images/image-settings/">caption</a> love.[/caption]\n\nThe image above happens to be <em><strong>centered</strong></em>. The caption also has a link in it, just to see if it does anything funky.\n\n[caption id="attachment_904" align="alignleft" width="150"]<img class="size-full wp-image-904  " title="Image Alignment 150x150" alt="Image Alignment 150x150" src="http://ellie.themes.zone/wp-content/uploads/2013/03/image-alignment-150x150.jpg" width="150" height="150" /> Itty-bitty caption.[/caption]\n\n<strong></strong>The rest of this paragraph is filler for the sake of seeing the text wrap around the 150x150 image, which is <em><strong>left aligned</strong></em>. <strong></strong>\n\nAs you can see the should be some space above, below, and to the right of the image. The text should not be creeping on the image. Creeping is just not right. Images need breathing room too. Let them speak like you words. Let them do their jobs without any hassle from the text. In about one more sentence here, we''ll see that the text moves from the right of the image down below the image in seamless transition. Again, letting the do it''s thang. Mission accomplished!\n\nAnd now for a <em><strong>massively large image</strong></em>. It also has <em><strong>no alignment</strong></em>.\n\n[caption id="attachment_907" align="alignnone" width="1200"]<img class=" wp-image-907" title="Image Alignment 1200x400" alt="Image Alignment 1200x400" src="http://ellie.themes.zone/wp-content/uploads/2013/03/image-alignment-1200x4002.jpg" width="1200" height="400" /> Massive image comment for your eyeballs.[/caption]\n\nThe image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.\n\n[caption id="attachment_905" align="alignright" width="300"]<img class="size-full wp-image-905 " title="Image Alignment 300x200" alt="Image Alignment 300x200" src="http://ellie.themes.zone/wp-content/uploads/2013/03/image-alignment-300x200.jpg" width="300" height="200" /> Feels good to be right all the time.[/caption]\n\nAnd now we''re going to shift things to the <em><strong>right align</strong></em>. Again, there should be plenty of room above, below, and to the left of the image. Just look at him there... Hey guy! Way to rock that right side. I don''t care what the left aligned image says, you look great. Don''t let anyone else tell you differently.\n\nIn just a bit here, you should see the text start to wrap below the right aligned image and settle in nicely. There should still be plenty of room and everything should be sitting pretty. Yeah... Just like that. It never felt so good to be right.\n\nAnd that''s a wrap, yo! You survived the tumultuous waters of alignment. Image alignment achievement unlocked!', 'Page Image Alignment', '', 'publish', 'open', 'open', '', 'page-image-alignment', '', '', '2013-03-15 18:19:23', '2013-03-15 23:19:23', '', 10, 'http://wptest.io/demo/?page_id=1080', 0, 'page', '', 0),
(1134, 2, '2013-03-15 18:20:05', '2013-03-15 23:20:05', '<strong>Headings</strong>\n<h1>Header one</h1>\n<h2>Header two</h2>\n<h3>Header three</h3>\n<h4>Header four</h4>\n<h5>Header five</h5>\n<h6>Header six</h6>\n<h2>Blockquotes</h2>\nSingle line blockquote:\n<blockquote>Stay hungry. Stay foolish.</blockquote>\nMulti line blockquote with a cite reference:\n<blockquote cite="https://developer.mozilla.org/en-US/docs/Web/HTML/Element/blockquote"><p>The <strong>HTML <code>&lt;blockquote&gt;</code> Element</strong> (or <em>HTML Block Quotation Element</em>) indicates that the enclosed text is an extended quotation. Usually, this is rendered visually by indentation (see <a href="https://developer.mozilla.org/en-US/docs/HTML/Element/blockquote#Notes">Notes</a> for how to change it). A URL for the source of the quotation may be given using the <strong>cite</strong> attribute, while a text representation of the source can be given using the <a href="https://developer.mozilla.org/en-US/docs/Web/HTML/Element/cite" title="The HTML Citation Element &lt;cite&gt; represents a reference to a creative work. It must include the title of a work or a URL reference, which may be in an abbreviated form according to the conventions used for the addition of citation metadata."><code>&lt;cite&gt;</code></a> element.</p></blockquote>\n<cite>multiple contributors</cite> - MDN HTML element reference - blockquote\n<h2>Tables</h2>\n<table>\n<tbody>\n<tr>\n<th>Employee</th>\n<th class="views">Salary</th>\n<th></th>\n</tr>\n<tr class="odd">\n<td><a href="http://example.com/">Jane</a></td>\n<td>$1</td>\n<td>Because that''s all Steve Job'' needed for a salary.</td>\n</tr>\n<tr class="even">\n<td><a href="http://example.com">John</a></td>\n<td>$100K</td>\n<td>For all the blogging he does.</td>\n</tr>\n<tr class="odd">\n<td><a href="http://example.com/">Jane</a></td>\n<td>$100M</td>\n<td>Pictures are worth a thousand words, right? So Tom x 1,000.</td>\n</tr>\n<tr class="even">\n<td><a href="http://example.com/">Jane</a></td>\n<td>$100B</td>\n<td>With hair like that?! Enough said...</td>\n</tr>\n</tbody>\n</table>\n<h2>Definition Lists</h2>\n<dl><dt>Definition List Title</dt><dd>Definition list division.</dd><dt>Startup</dt><dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd><dt>#dowork</dt><dd>Coined by Rob Dyrdek and his personal body guard Christopher "Big Black" Boykins, "Do Work" works as a self motivator, to motivating your friends.</dd><dt>Do It Live</dt><dd>I''ll let Bill O''Reilly will <a title="We''ll Do It Live" href="https://www.youtube.com/watch?v=O_HyZ5aW76c">explain</a> this one.</dd></dl>\n<h2>Unordered Lists (Nested)</h2>\n<ul>\n	<li>List item one\n<ul>\n	<li>List item one\n<ul>\n	<li>List item one</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n<h2>Ordered List (Nested)</h2>\n<ol start="8">\n 	<li>List item one -start at 8\n<ol>\n 	<li>List item one\n<ol reversed="reversed">\n 	<li>List item one -reversed attribute</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n<h2>HTML Tags</h2>\nThese supported tags come from the WordPress.com code <a title="Code" href="https://en.support.wordpress.com/code/">FAQ</a>.\n\n<strong>Address Tag</strong>\n\n<address>1 Infinite Loop\nCupertino, CA 95014\nUnited States</address><strong>Anchor Tag (aka. Link)</strong>\n\nThis is an example of a <a title="Apple" href="http://apple.com">link</a>.\n\n<strong>Abbreviation Tag</strong>\n\nThe abbreviation <abbr title="Seriously">srsly</abbr> stands for "seriously".\n\n<strong>Acronym Tag (<em>deprecated in HTML5</em>)</strong>\n\nThe acronym <acronym title="For The Win">ftw</acronym> stands for "for the win".\n\n<strong>Big Tag</strong> (<em>deprecated in HTML5</em>)\n\nThese tests are a <big>big</big> deal, but this tag is no longer supported in HTML5.\n\n<strong>Cite Tag</strong>\n\n"Code is poetry." --<cite>Automattic</cite>\n\n<strong>Code Tag</strong>\n\nThis tag styles blocks of code.\n<code>.post-title {\n	margin: 0 0 5px;\n	font-weight: bold;\n	font-size: 38px;\n	line-height: 1.2;\n	and here''s a line of some really, really, really, really long text, just to see how it is handled and to find out how it overflows;\n}</code>\nYou will learn later on in these tests that word-wrap: break-word;will be your best friend.\n\n<strong>Delete Tag</strong>\n\nThis tag will let you <del cite="deleted it">strike out text</del>, but this tag is <em>recommended</em> supported in HTML5 (use the <code>&lt;s&gt;</code> instead).\n\n<strong>Emphasize Tag</strong>\n\nThe emphasize tag should <em>italicize</em> <i>text</i>.\n\n<strong>Horizontal Rule Tag</strong>\n\n<hr />\n\nThis sentence is following a <code>&lt;hr /&gt;</code> tag.\n\n<strong>Insert Tag</strong>\n\nThis tag should denote <ins cite="inserted it">inserted</ins> text.\n\n<strong>Keyboard Tag</strong>\n\nThis scarcely known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Preformatted Tag</strong>\n\nThis tag is for preserving whitespace as typed, such as in poetry or ASCII art.\n<pre>\n<h2>The Road Not Taken</h2>\n<cite>Robert Frost</cite>\n\n\n  Two roads diverged in a yellow wood,\n  And sorry I could not travel both          (\\_/)\n  And be one traveler, long I stood         (=''.''=)\n  And looked down one as far as I could     (")_(")\n  To where it bent in the undergrowth;\n\n  Then took the other, as just as fair,\n  And having perhaps the better claim,          |\\_/|\n  Because it was grassy and wanted wear;       / @ @ \\\n  Though as for that the passing there        ( > º < )\n  Had worn them really about the same,         `>>x<<´\n                                               /  O  \\\n  And both that morning equally lay\n  In leaves no step had trodden black.\n  Oh, I kept the first for another day!\n  Yet knowing how way leads on to way,\n  I doubted if I should ever come back.\n\n  I shall be telling this with a sigh\n  Somewhere ages and ages hence:\n  Two roads diverged in a wood, and I—\n  I took the one less traveled by,\n  And that has made all the difference.\n\n\n  and here''s a line of some really, really, really, really long text, just to see how it is handled and to find out how it overflows;\n</pre>\n<strong>Quote Tag</strong> for short, inline quotes\n\n<q>Developers, developers, developers...</q> --Steve Ballmer\n\n<strong>Strike Tag</strong> (<em>deprecated in HTML5</em>) and <strong>S Tag</strong>\n\nThis tag shows <strike>strike-through</strike> <s>text</s>.\n\n<strong>Small Tag</strong>\n\nThis tag shows <small>smaller<small> text.</small></small>\n\n<strong>Strong Tag</strong>\n\nThis tag shows <strong>bold<strong> text.</strong></strong>\n\n<strong>Subscript Tag</strong>\n\nGetting our science styling on with H<sub>2</sub>O, which should push the "2" down.\n\n<strong>Superscript Tag</strong>\n\nStill sticking with science and Albert Einstein''s E = MC<sup>2</sup>, which should lift the 2 up.\n\n<strong>Teletype Tag </strong>(<em>obsolete in HTML5</em>)\n\nThis rarely used tag emulates <tt>teletype text</tt>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Underline Tag</strong> <em>deprecated in HTML 4, re-introduced in HTML5 with other semantics</em>\n\nThis tag shows <u>underlined text</u>.\n\n<strong>Variable Tag</strong>\n\nThis allows you to denote <var>variables</var>.', 'Page Markup And Formatting', '', 'publish', 'open', 'open', '', 'page-markup-and-formatting', '', '', '2013-03-15 18:20:05', '2013-03-15 23:20:05', '', 10, 'http://wptest.io/demo/?page_id=1083', 0, 'page', '', 0),
(1148, 2, '2012-01-03 10:11:37', '2012-01-03 17:11:37', 'This post tests comments in the following ways.\r\n<ul>\r\n	<li>Threaded comments up to 10 levels deep</li>\r\n	<li>Paginated comments (set <em><strong>Settings &gt; Discussion &gt; Break comments into pages</strong></em> to <em><strong>5</strong></em> top level comments per page)</li>\r\n	<li>Comment markup / formatting</li>\r\n	<li>Comment images</li>\r\n	<li>Comment videos</li>\r\n	<li>Author comments</li>\r\n	<li>Gravatars and default fallbacks</li>\r\n</ul>', 'Template: Comments', '', 'publish', 'open', 'closed', '', 'template-comments', '', '', '2018-04-10 17:34:54', '2018-04-10 17:34:54', '', 0, 'https://wpthemetestdata.wordpress.com/2007/09/04/comment-test/', 0, 'post', '', 19),
(1176, 2, '2013-01-09 09:00:39', '2013-01-09 16:00:39', '<h3>Default</h3>\r\nThis is a paragraph. It should not have any alignment of any kind. It should just flow like you would normally expect. Nothing fancy. Just straight up text, free flowing, with love. Completely neutral and not picking a side or sitting on the fence. It just is. It just freaking is. It likes where it is. It does not feel compelled to pick a side. Leave him be. It will just be better that way. Trust me.\r\n\r\n<!--more-->\r\n\r\n<h3>Left Align</h3>\r\n<p style="text-align:left;">This is a paragraph. It is left aligned. Because of this, it is a bit more liberal in it''s views. It''s favorite color is green. Left align tends to be more eco-friendly, but it provides no concrete evidence that it really is. Even though it likes share the wealth evenly, it leaves the equal distribution up to justified alignment.</p>\r\n\r\n<h3>Center Align</h3>\r\n<p style="text-align:center;">This is a paragraph. It is center aligned. Center is, but nature, a fence sitter. A flip flopper. It has a difficult time making up its mind. It wants to pick a side. Really, it does. It has the best intentions, but it tends to complicate matters more than help. The best you can do is try to win it over and hope for the best. I hear center align does take bribes.</p>\r\n\r\n<h3>Right Align</h3>\r\n<p style="text-align:right;">This is a paragraph. It is right aligned. It is a bit more conservative in it''s views. It''s prefers to not be told what to do or how to do it. Right align totally owns a slew of guns and loves to head to the range for some practice. Which is cool and all. I mean, it''s a pretty good shot from at least four or five football fields away. Dead on. So boss.</p>\r\n\r\n<h3>Justify Align</h3>\r\n<p style="text-align:justify;">This is a paragraph. It is justify aligned. It gets really mad when people associate it with Justin Timberlake. Typically, justified is pretty straight laced. It likes everything to be in it''s place and not all cattywampus like the rest of the aligns. I am not saying that makes it better than the rest of the aligns, but it does tend to put off more of an elitist attitude.</p>', 'Markup: Text Alignment', '', 'publish', 'closed', 'closed', '', 'markup-text-alignment', '', '', '2018-04-10 17:33:37', '2018-04-10 17:33:37', '', 0, 'http://wptest.io/demo/?p=895', 0, 'post', '', 0),
(1178, 2, '2013-01-11 20:22:19', '2013-01-12 03:22:19', 'Sed nisl nisl, euismod eget dolor nec, ultrices tempus risus. Mauris sed mollis lacus. Fusce tristique velit massa, quis interdum turpis semper luctus. Integer porta ligula arcu, a placerat est elementum faucibus. Etiam tempus sodales risus, in porttitor quam sollicitudin sed. Nullam venenatis enim erat, et vulputate tellus consequat ac. Duis viverra enim auctor laoreet suscipit.\r\n\r\n<!--more-->\r\n\r\n<strong>Headings</strong>\r\n<h1>Header one</h1>\r\n<h2>Header two</h2>\r\n<h3>Header three</h3>\r\n<h4>Header four</h4>\r\n<h5>Header five</h5>\r\n<h6>Header six</h6>\r\n<h2>Blockquotes</h2>\r\nSingle line blockquote:\r\n<blockquote>Stay hungry. Stay foolish.</blockquote>\r\nMulti line blockquote with a cite reference:\r\n\r\n<blockquote cite="https://developer.mozilla.org/en-US/docs/Web/HTML/Element/blockquote">The <strong>HTML <code>&lt;blockquote&gt;</code> Element</strong> (or <em>HTML Block Quotation Element</em>) indicates that the enclosed text is an extended quotation. Usually, this is rendered visually by indentation (see <a href="https://developer.mozilla.org/en-US/docs/HTML/Element/blockquote#Notes">Notes</a> for how to change it). A URL for the source of the quotation may be given using the <strong>cite</strong> attribute, while a text representation of the source can be given using the <a title="The HTML Citation Element &lt;cite&gt; represents a reference to a creative work. It must include the title of a work or a URL reference, which may be in an abbreviated form according to the conventions used for the addition of citation metadata." href="https://developer.mozilla.org/en-US/docs/Web/HTML/Element/cite"><code>&lt;cite&gt;</code></a> element.</blockquote>\r\n\r\n<cite>multiple contributors</cite> - MDN HTML element reference - blockquote\r\n<h2>Tables</h2>\r\n<table>\r\n<thead>\r\n<tr>\r\n<th>Employee</th>\r\n<th>Salary</th>\r\n<th></th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<th><a href="http://example.org/">John Doe</a></th>\r\n<td>$1</td>\r\n<td>Because that''s all Steve Jobs needed for a salary.</td>\r\n</tr>\r\n<tr>\r\n<th><a href="http://example.org/">Jane Doe</a></th>\r\n<td>$100K</td>\r\n<td>For all the blogging she does.</td>\r\n</tr>\r\n<tr>\r\n<th><a href="http://example.org/">Fred Bloggs</a></th>\r\n<td>$100M</td>\r\n<td>Pictures are worth a thousand words, right? So Jane x 1,000.</td>\r\n</tr>\r\n<tr>\r\n<th><a href="http://example.org/">Jane Bloggs</a></th>\r\n<td>$100B</td>\r\n<td>With hair like that?! Enough said...</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Definition Lists</h2>\r\n<dl>\r\n 	<dt>Definition List Title</dt>\r\n 	<dd>Definition list division.</dd>\r\n 	<dt>Startup</dt>\r\n 	<dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd>\r\n 	<dt>#dowork</dt>\r\n 	<dd>Coined by Rob Dyrdek and his personal body guard Christopher "Big Black" Boykins, "Do Work" works as a self motivator, to motivating your friends.</dd>\r\n 	<dt>Do It Live</dt>\r\n 	<dd>I''ll let Bill O''Reilly will <a title="We''ll Do It Live" href="https://www.youtube.com/watch?v=O_HyZ5aW76c">explain</a> this one.</dd>\r\n</dl>\r\n<h2>Unordered Lists (Nested)</h2>\r\n<ul>\r\n 	<li>List item one\r\n<ul>\r\n 	<li>List item one\r\n<ul>\r\n 	<li>List item one</li>\r\n 	<li>List item two</li>\r\n 	<li>List item three</li>\r\n 	<li>List item four</li>\r\n</ul>\r\n</li>\r\n 	<li>List item two</li>\r\n 	<li>List item three</li>\r\n 	<li>List item four</li>\r\n</ul>\r\n</li>\r\n 	<li>List item two</li>\r\n 	<li>List item three</li>\r\n 	<li>List item four</li>\r\n</ul>\r\n<h2>Ordered List (Nested)</h2>\r\n<ol start="8">\r\n 	<li>List item one -start at 8\r\n<ol>\r\n 	<li>List item one\r\n<ol reversed="reversed">\r\n 	<li>List item one -reversed attribute</li>\r\n 	<li>List item two</li>\r\n 	<li>List item three</li>\r\n 	<li>List item four</li>\r\n</ol>\r\n</li>\r\n 	<li>List item two</li>\r\n 	<li>List item three</li>\r\n 	<li>List item four</li>\r\n</ol>\r\n</li>\r\n 	<li>List item two</li>\r\n 	<li>List item three</li>\r\n 	<li>List item four</li>\r\n</ol>\r\n<h2>HTML Tags</h2>\r\nThese supported tags come from the WordPress.com code <a title="Code" href="https://en.support.wordpress.com/code/">FAQ</a>.\r\n\r\n<strong>Address Tag</strong>\r\n\r\n<address>1 Infinite Loop\r\nCupertino, CA 95014\r\nUnited States</address><strong>Anchor Tag (aka. Link)</strong>\r\n\r\nThis is an example of a <a title="Apple" href="http://apple.com">link</a>.\r\n\r\n<strong>Abbreviation Tag</strong>\r\n\r\nThe abbreviation <abbr title="Seriously">srsly</abbr> stands for "seriously".\r\n\r\n<strong>Acronym Tag (<em>deprecated in HTML5</em>)</strong>\r\n\r\nThe acronym <acronym title="For The Win">ftw</acronym> stands for "for the win".\r\n\r\n<strong>Big Tag</strong> (<em>deprecated in HTML5</em>)\r\n\r\nThese tests are a <big>big</big> deal, but this tag is no longer supported in HTML5.\r\n\r\n<strong>Cite Tag</strong>\r\n\r\n"Code is poetry." --<cite>Automattic</cite>\r\n\r\n<strong>Code Tag</strong>\r\n\r\nThis tag styles blocks of code.\r\n<code>.post-title {\r\nmargin: 0 0 5px;\r\nfont-weight: bold;\r\nfont-size: 38px;\r\nline-height: 1.2;\r\nand here''s a line of some really, really, really, really long text, just to see how it is handled and to find out how it overflows;\r\n}</code>\r\nYou will learn later on in these tests that word-wrap: break-word;will be your best friend.\r\n\r\n<strong>Delete Tag</strong>\r\n\r\nThis tag will let you <del cite="deleted it">strike out text</del>, but this tag is <em>recommended</em> supported in HTML5 (use the <code>&lt;s&gt;</code> instead).\r\n\r\n<strong>Emphasize Tag</strong>\r\n\r\nThe emphasize tag should <em>italicize</em> <i>text</i>.\r\n\r\n<strong>Horizontal Rule Tag</strong>\r\n\r\n<hr />\r\n\r\nThis sentence is following a <code>&lt;hr /&gt;</code> tag.\r\n\r\n<strong>Insert Tag</strong>\r\n\r\nThis tag should denote <ins cite="inserted it">inserted</ins> text.\r\n\r\n<strong>Keyboard Tag</strong>\r\n\r\nThis scarcely known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.\r\n\r\n<strong>Preformatted Tag</strong>\r\n\r\nThis tag is for preserving whitespace as typed, such as in poetry or ASCII art.\r\n<h2>The Road Not Taken</h2>\r\n<cite>Robert Frost</cite> Two roads diverged in a yellow wood, And sorry I could not travel both (\\_/) And be one traveler, long I stood (=''.''=) And looked down one as far as I could (")_(") To where it bent in the undergrowth; Then took the other, as just as fair, And having perhaps the better claim, |\\_/| Because it was grassy and wanted wear; / @ @ \\ Though as for that the passing there ( &gt; º &lt; ) Had worn them really about the same, `&gt;&gt;x&lt;&lt;´ / O \\ And both that morning equally lay In leaves no step had trodden black. Oh, I kept the first for another day! Yet knowing how way leads on to way, I doubted if I should ever come back. I shall be telling this with a sigh Somewhere ages and ages hence: Two roads diverged in a wood, and I— I took the one less traveled by, And that has made all the difference. and here''s a line of some really, really, really, really long text, just to see how it is handled and to find out how it overflows;\r\n\r\n<strong>Quote Tag</strong> for short, inline quotes\r\n\r\n<q>Developers, developers, developers...</q> --Steve Ballmer\r\n\r\n<strong>Strike Tag</strong> (<em>deprecated in HTML5</em>) and <strong>S Tag</strong>\r\n\r\nThis tag shows <span style="text-decoration: line-through;">strike-through</span> <s>text</s>.\r\n\r\n<strong>Small Tag</strong>\r\n\r\nThis tag shows <small>smaller<small> text.</small></small>\r\n\r\n<strong>Strong Tag</strong>\r\n\r\nThis tag shows <strong>bold<strong> text.</strong></strong>\r\n\r\n<strong>Subscript Tag</strong>\r\n\r\nGetting our science styling on with H<sub>2</sub>O, which should push the "2" down.\r\n\r\n<strong>Superscript Tag</strong>\r\n\r\nStill sticking with science and Albert Einstein''s E = MC<sup>2</sup>, which should lift the 2 up.\r\n\r\n<strong>Teletype Tag </strong>(<em>obsolete in HTML5</em>)\r\n\r\nThis rarely used tag emulates <tt>teletype text</tt>, which is usually styled like the <code>&lt;code&gt;</code> tag.\r\n\r\n<strong>Underline Tag</strong> <em>deprecated in HTML 4, re-introduced in HTML5 with other semantics</em>\r\n\r\nThis tag shows <u>underlined text</u>.\r\n\r\n<strong>Variable Tag</strong>\r\n\r\nThis allows you to denote <var>variables</var>.', 'Markup: HTML Tags and Formatting', '', 'publish', 'closed', 'closed', '', 'markup-html-tags-and-formatting', '', '', '2018-04-10 17:45:31', '2018-04-10 17:45:31', '', 0, 'http://wptest.io/demo/?p=919', 0, 'post', '', 0),
