(2221, 1, '2018-03-27 09:57:43', '2018-03-27 09:57:43', '<h2>About Us</h2>		\n			OUR MISSION		\n			<h3>Ellie is a Stockholm-based, premium perfume company<br/>\nobsessed with fashion and creativity.</h3>		\n		A simple experiment with nature.  An endeavor to create a product that encompasses the individuality and uniqueness that can only be found in natural surroundings. A desire to experiment with design, materials, and aesthetics in the search for something that works. Free from passing trends, the brand’s focus remains that of its roots, innovation and creation. Long live creativity.https://www.youtube.com/watch?v=UMtA7vHmSAA		\n                <h5>\n                    SIMPLICITY IN DESIGN\n                </h5>\n                <p>Nunc ac gravida arcu. Vivamus vestibulum blandit ex, ac porta lacus varius nec.\nNulla sit amet dolor sem. Pellentesque sed erat vitae nulla vulputate.</p>\n                <h5>\n                    CONFIDENCE IN COMFORT\n                </h5>\n                <p>Nunc ac gravida arcu. Vivamus vestibulum blandit ex, ac porta lacus varius nec.\nNulla sit amet dolor sem. Pellentesque sed erat vitae nulla vulputate.</p>\n                <h5>\n                    Natural Quality\n                </h5>\n                <p>Nunc ac gravida arcu. Vivamus vestibulum blandit ex, ac porta lacus varius nec.\nNulla sit amet dolor sem. Pellentesque sed erat vitae nulla vulputate.</p>\n										<img width="640" height="442" src="http://ellie.themes.zone/wp-content/uploads/2018/03/apparel-boutique-colors-135620-1024x707.jpg" alt="" srcset="http://ellie.themes.zone/wp-content/uploads/2018/03/apparel-boutique-colors-135620-1024x707.jpg 1024w, http://ellie.themes.zone/wp-content/uploads/2018/03/apparel-boutique-colors-135620-300x207.jpg 300w, http://ellie.themes.zone/wp-content/uploads/2018/03/apparel-boutique-colors-135620-768x530.jpg 768w, http://ellie.themes.zone/wp-content/uploads/2018/03/apparel-boutique-colors-135620-600x414.jpg 600w" sizes="(max-w